import React from 'react';
import Pokemon from './pokemon';
import './App.css';

const Home = () => {
    const [state, setState] = React.useState(false);
    const [state2, setState2] = React.useState(false);

    return(
        <div>
            <header>
            <h2>Pokedex</h2>
            <nav>
                <ul>
                    <li><button onClick={() => setState(!state)}>Pokemon List</button></li>
                    <li><button onClick={() => setState2(!state2)}>About</button></li>
                </ul>
            </nav>
            </header>
            {state && <Pokemon />}
            {state2 && <p>This is a pokedex app made on React JS</p>}
        </div>
    )
}

export default Home;
